import Foundation

struct Day05Manager {
    
    let input = ""
    
    func getInactivatedPolymersCount(with input: String? = nil) -> Int {
        var activating = true
        var trimmed = input ?? self.input
        repeat {
            let newTrimmed = trimmed.replacingOccurrences(of: "Aa|aA|Bb|bB|Cc|cC|Dd|dD|Ee|eE|Ff|fF|Gg|gG|Hh|hH|Ii|iI|Jj|jJ|Kk|kK|Ll|lL|Mm|mM|Nn|nN|Oo|oO|Pp|pP|Qq|qQ|Rr|rR|Ss|sS|Tt|tT|Uu|uU|Vv|vV|Ww|wW|Xx|xX|Yy|yY|Zz|zZ",
                                                   with: "",
                                                   options: .regularExpression)
            if newTrimmed != trimmed {
                trimmed = newTrimmed
            } else {
                activating = false
            }
        } while activating
        return trimmed.count
    }
}
